class Solution:
    def winnerOfGame(self, colors: str) -> bool:
        total_alice, total_bob = 0, 0
        alice, bob = 0, 0
        for color in colors:
            if color == 'A':
                alice += 1
                if bob >= 3:
                    total_bob += bob - 2
                bob = 0
            else:
                bob += 1
                if alice >= 3:
                    total_alice += alice - 2
                alice = 0
        if bob >= 3:
            total_bob += bob - 2
        if alice >= 3:
            total_alice += alice - 2
        return total_alice > total_bob

